 Here's a Python program that prints out the first 100 prime numbers:

```python
def is_prime(n):
    if n <= 1:
        return False
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            return False
    return True

primes = []
for num in range(2, 101):
    if is_prime(num):
        primes.append(num)

print("First 100 Prime Numbers:")
for prime in primes[:100]:
    print(prime)
```

This program defines a function `is_prime` to check if a given number is prime or not. It then iterates through numbers from 2 to 100 and appends each prime number to the `primes` list. Finally, it prints out the first 100 prime numbers.
